import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Layers, Cloud, Globe, Satellite, ChevronDown, ChevronUp, Lightbulb, Code } from 'lucide-react';
import { Link } from 'react-router-dom';

const Services = () => {
  const [openService, setOpenService] = useState(null);

  const serviceItems = [
    {
      id: 'analysis',
      icon: Layers,
      title: 'Análisis de Datos Espaciales',
      description: 'Transformamos grandes volúmenes de datos geográficos en insights claros y estratégicos para tu negocio.',
      details: 'Utilizamos técnicas avanzadas de procesamiento y modelado espacial para extraer patrones, tendencias y relaciones ocultas en tus datos. Desde análisis de densidad hasta modelado de superficies, te proporcionamos la información que necesitas para tomar decisiones informadas.',
      future: 'Integración con Google Earth Engine para análisis de teledetección y monitoreo ambiental a gran escala, permitiendo el procesamiento de petabytes de datos satelitales.',
    },
    {
      id: 'webgis',
      icon: Cloud,
      title: 'Desarrollo de Aplicaciones WebGIS',
      description: 'Creamos plataformas interactivas y personalizadas para visualizar y gestionar tu información geográfica en la web.',
      details: 'Diseñamos y desarrollamos aplicaciones web geoespaciales a medida, desde visores de mapas simples hasta complejos sistemas de gestión de activos basados en la ubicación. Nuestras soluciones son intuitivas, escalables y accesibles desde cualquier dispositivo.',
      future: 'Aplicaciones personalizadas con control de parámetros para análisis en tiempo real, donde los usuarios podrán interactuar directamente con los motores de procesamiento geoespacial en la nube.',
    },
    {
      id: 'consulting',
      icon: Globe,
      title: 'Consultoría Geoespacial',
      description: 'Asesoramiento experto para la implementación de proyectos GIS, teledetección y geodesia.',
      details: 'Nuestro equipo de expertos te guiará en cada etapa de tu proyecto geoespacial, desde la conceptualización y planificación hasta la implementación y capacitación. Optimizamos tus flujos de trabajo y te ayudamos a elegir las tecnologías más adecuadas.',
      future: 'Talleres especializados y programas de mentoría en el uso de Google Earth Engine y otras plataformas de análisis geoespacial en la nube para diversas aplicaciones industriales y de investigación.',
    },
    {
      id: 'satellite',
      icon: Satellite,
      title: 'Procesamiento de Imágenes Satelitales',
      description: 'Extracción de información valiosa de imágenes de satélite para diversas aplicaciones.',
      details: 'Realizamos el preprocesamiento, análisis y clasificación de imágenes satelitales de diversas fuentes (Sentinel, Landsat, Planet, etc.) para aplicaciones como monitoreo agrícola, detección de cambios, mapeo de cobertura terrestre y análisis ambiental.',
      future: 'Automatización de flujos de trabajo de procesamiento con acceso a grandes volúmenes de datos satelitales y algoritmos de aprendizaje automático para una extracción de información más rápida y precisa.',
    },
  ];

  const toggleService = (id) => {
    setOpenService(openService === id ? null : id);
  };

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.7 }}
      className="py-12"
    >
      <h1 className="text-4xl font-extrabold text-center text-gray-900 mb-10 bg-clip-text text-transparent bg-gradient-to-r from-blue-700 to-purple-600">
        Nuestros Servicios Geoespaciales
      </h1>
      <p className="text-xl text-center text-gray-600 mb-12 max-w-3xl mx-auto">
        Ofrecemos soluciones innovadoras para transformar tus datos geográficos en información valiosa y accionable.
      </p>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8"> {/* Usar grid para tarjetas */}
        {serviceItems.map((service) => (
          <motion.div
            key={service.id}
            className="bg-white rounded-xl shadow-lg overflow-hidden"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.1 }}
          >
            <button
              className="w-full flex items-center justify-between p-6 md:p-8 text-left focus:outline-none"
              onClick={() => toggleService(service.id)}
            >
              <div className="flex items-center gap-4">
                <div className="p-3 bg-blue-100 rounded-full">
                  <service.icon className="w-8 h-8 text-blue-600" />
                </div>
                <h3 className="text-2xl font-semibold text-gray-800">{service.title}</h3>
              </div>
              <motion.div
                initial={false}
                animate={{ rotate: openService === service.id ? 180 : 0 }}
                transition={{ duration: 0.3 }}
              >
                {openService === service.id ? <ChevronUp size={28} className="text-gray-600" /> : <ChevronDown size={28} className="text-gray-600" />}
              </motion.div>
            </button>

            <AnimatePresence>
              {openService === service.id && (
                <motion.div
                  initial={{ opacity: 0, height: 0 }}
                  animate={{ opacity: 1, height: 'auto' }}
                  exit={{ opacity: 0, height: 0 }}
                  transition={{ duration: 0.4, ease: "easeInOut" }}
                  className="px-6 md:px-8 pb-6 md:pb-8 border-t border-gray-200"
                >
                  <p className="text-gray-700 mb-4 leading-relaxed">{service.description}</p>
                  <p className="text-gray-700 mb-4 leading-relaxed">{service.details}</p>
                  <p className="text-blue-600 font-medium text-sm">
                    <Lightbulb className="inline-block w-4 h-4 mr-1" />
                    A futuro: {service.future}
                  </p>
                </motion.div>
              )}
            </AnimatePresence>
          </motion.div>
        ))}
      </div>

      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 0.5 }}
        className="mt-16 text-center"
      >
        <h2 className="text-3xl font-bold text-gray-800 mb-6">
          ¿Necesitas una solución a medida?
        </h2>
        <p className="text-lg text-gray-700 max-w-2xl mx-auto">
          Si tienes un proyecto específico en mente, nuestro equipo de desarrollo está listo para crear la solución geoespacial que necesitas. ¡Contáctanos!
        </p>
        <Link
          to="/contact"
          className="mt-8 inline-flex items-center px-8 py-4 bg-gradient-to-r from-blue-600 to-purple-600 text-white text-lg font-semibold rounded-full shadow-lg hover:shadow-xl transform hover:scale-105 transition-all duration-300"
        >
          <Code className="mr-3" /> Solicitar Consultoría
        </Link>
      </motion.div>
    </motion.div>
  );
};

export default Services;
